const Sum = function(a) {
    let c = 0;

    for (let i = 0; i < a.length; i++) {
        c = c + a[i];
    };

    return c;
};

const Mul = function(x, w) {
    let c = [];

    for (let i = 0; i < x.length; i++) {
        c[i] = x[i] * w[i];
    };

    return c;
};

const Dot = function(x, w) {
    let c = [];
    
    for (let i = 0; i < w.length; i++) {
        c[i] = Sum(Mul(x, w[i]));
    };

    return c;
};

const ReLU = function(a) {
    let c = [];
    
    for (let i = 0; i < a.length; i++) {
        c[i] = Math.max(a[i], 0);
    };

    return c;
};

const Softsign = function(a) {
    let c = [];
    
    for (let i = 0; i < a.length; i++) {
        c[i] = a[i] / (1 + Math.abs(a[i]));
    };

    return c;
}

